import "./App.css";
import PowerBI from "./Components/powerbi_poc";

function App() {
  return (
    <div className="App">
      <div style={{ display: "flex" }}>
        <div style={{ margin: "50px" }}>
          <img
            src=" Images/pepsico_logo.png"
            alt=""
            width={100}
            height={100}
          ></img>
        </div>
        <div style={{ width: "80%" }}>
          <h1>Total Portfolio Optimization Demo</h1>
          <p>This is a demo of embeding PowerBI Reports</p>
        </div>
      </div>
      <PowerBI height="100%"></PowerBI>
    </div>
  );
}

export default App;
